	(6, 'Pícaro', 'Centrados en el ataque sopresa, los pícaros rara vez comienzan un combate de frente. Suelen esperar al momento oportuno para asestar un golpe crítico a sus oponentes.', 7, 1, 1, 1, 3, 1, 2, 5);
